import React, { useContext } from 'react'
import '../../public/assets/style.scss';
import Menu from './menu';

import { ProfileContext } from '../../store/contexts/profileContext'
import Logout from '../../utility/logout'



function Navbar() {

    const { dispatch  } = useContext(ProfileContext);


    const handleLogout = ()=>{
        dispatch({type: 'CLEAR_CONTEXT'});
        Logout();
    }

    return (
        <div>
            <nav className="navbar">
                <div className="two-column-row">
                    <div className="column"> <img src="/images/ubelogo.jpeg" alt="logo" height="50px" width="150px"/></div>

                    <div id="profilePic" className="column"><button onClick={handleLogout}>Logout</button></div>
                </div>
            </nav>
        </div>
    )

}

export default Navbar
